caption_original:
Le saviez-vous? La Garde côtière canadienne fournit des services de déglaçage aux navires commerciaux, aux traversiers et aux bateaux de pêche dans les eaux canadiennes couvertes de glace, y compris les services suivants : escorte de navires, déglaçage des ports, entretien des voies de navigation et services d'information sur les glaces. Ces services :

• assurent une navigation sécuritaire;
• empêchent la formation d'embâcles et les inondations;
• maintiennent les voies de navigation ouvertes pour le commerce maritime.

Apprenez-en plus à http://www.ccg-gcc.gc.ca/Deglacage/accueil

