Les pouvoirs d'application de la loi de l'OTC sont définis dans la législation et la réglementation. L'OTC exerce ses pouvoirs d'application de la loi en :

• faisant en sorte que les aéronefs soient assurés et autorisés à offrir un service aérien en vertu d'une licence de Transports Canada;
• vérifiant les dossiers de vol, les billets, les factures et les autres documents financiers;
• examinant les tarifs des compagnies aériennes pour s'assurer de leur conformité avec la licence visée et la loi;
• veillant à ce que les compagnies aient en place des programmes de formation pour former les employés à aider les personnes ayant une déficience;
• faisant en sorte que les annonceurs des prix des services aériens se conforment à la réglementation sur les prix tout compris des billets d'avion.

Pour plus de détails, consultez le http://ow.ly/GCF930ejTLS
